void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord/iResolution.xy * 2. - 1.;
    uv.y = - uv.y;
    uv.y = uv.y * (iResolution.y / iResolution.x) / (200.0 / 500.0);
    uv *= 1.2;
    if (any(greaterThan(abs(uv), vec2(1.0))))
    {
        fragColor = vec4(0.);
        return;
    }
    float t0 = iTime * 3.1415 * 2.0 * 2.5;
    float t1 = iTime * 3.1415 * 4.0 * 2.5;
    vec3 col = eval(vec4(uv, 0.2 * vec2(cos(t0), sin(t0))), 0.2 * vec4(cos(t1), sin(t1), 0., 0.));
    fragColor = vec4(col * 0.5 + 0.5,1.0);
}
